import React from "react";
import { Button } from "@mui/material";

const Todolistshow = () => {
  return (
    <div>
      <br />
      <h1 style={{ color: "white" }}>Feature</h1>
      <div className="box">
        <br />
        <h2>Feature</h2>
        <br />
        <div className="box2">
          <input
            type={"text"}
            placeholder="Enter Project Name"
            className="bold"
            value={name.projname}
            onChange={(e) => setname({ ...name, projname: e.target.value })} //must write ...name
          />
          &nbsp;&nbsp;
          <Button variant="contained" color="warning">
            Save
          </Button>
          <br />
          <br />
          <hr />
          <div className="over">
            <Table>
              <tbody>
                {feature?.map((value, index) => {
                  return (
                    <>
                      <tr key={index} className="prj">
                        <td align="left">
                          &nbsp;&nbsp;
                          {value.id})&nbsp;
                          {value.name}
                        </td>
                        <td>
                          <AiFillEdit
                            onClick={() => {
                              setname({ projname: value.name, id: value.id });
                            }}
                          />
                          &nbsp;&nbsp;&nbsp;
                          <AiFillDelete
                            style={{ color: "red" }}
                            // onClick={() => dispatch(ProjDelete(value.id))}
                          />
                        </td>
                      </tr>
                      <br />
                    </>
                  );
                })}
              </tbody>
            </Table>
            <input
              type="text"
              id="position"
              placeholder="Add A Project Name"
              onChange={(e) => {
                setname({ ...name, projAdd: e.target.value });
              }}
            />
            <FcPlus id="fix" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Todolistshow;
